(function ($) {
  DJ.addBehavior('BannerTile', '.banner-tile', {
    attach: function attach() {
      var bannerTile = this;
      var bannerBg = bannerTile.querySelector('.banner-tile__bg');
      var bannerVideo = bannerTile.querySelector('.video-js');
      var youtubeVideo = bannerTile.querySelector('.responsive-video');

      var aspectRatioCheck = function aspectRatioCheck() {
        var orientation;
        var ratio = 16 / 9;
        var bannerWidth = bannerBg.offsetWidth;
        var bannerHeight = bannerBg.offsetHeight;
        var aspect = bannerWidth / bannerHeight;
        var px = 'px';

        if (aspect > ratio) {
          orientation = 'landscape';
        } else {
          orientation = 'portrait';
        }

        if (orientation === 'landscape') {
          if (bannerVideo) {
            bannerVideo.style.width = '100%';
            bannerVideo.style.height = bannerWidth / ratio + px;
          }

          if (youtubeVideo) {
            youtubeVideo.style.width = '100%';
            youtubeVideo.style.height = bannerWidth / ratio + px;
          }
        } else {
          if (bannerVideo) {
            bannerVideo.style.width = bannerHeight * ratio + px;
            bannerVideo.style.height = '100%';
          }

          if (youtubeVideo) {
            youtubeVideo.style.width = bannerHeight * ratio + px;
            youtubeVideo.style.height = '100%';
          }
        }
      };

      aspectRatioCheck();
      window.addEventListener('resize', function () {
        aspectRatioCheck();
      }, true);
    }
  });
})(jQuery);
