(function ($) {
  DJ.addBehavior('conditionSearch', {
    attach: function attach() {
      var options = {
        valueNames: ['product-list__results-link', 'product-list__results-item'],
        listClass: 'product-list__results-list'
      };
      var searchList = new List('condition-search', options);
      var $searchField = $('.condition-search input.form-text');
      var $submitButton = $('#condition-search .form-actions button');
      $('.product-list-search-form .search-field').on('autocompleteselect', function (event, ui) {
        $(this).attr('data-nid', ui.item.nid);
        $(this).attr('data-url', ui.item.url);
      });
      $('.product-list-search-form .search-field').on('input', function () {
        if ($(this).val() === '') {
          $(this).removeAttr('data-nid');
          $(this).removeAttr('data-url');
        }
      });
      $searchField.bind('enterKey', function (e) {
        e.preventDefault();

        if ($(this).closest('.product-list-search-form').find('.search-field').attr('data-url') === undefined) {
          searchList.search($(this).val());
        } else {
          window.location.href = $(this).attr('data-url');
        }
      });
      $searchField.keyup(function (e) {
        if (e.keyCode === 13 || $(this).val() === '') {
          $(this).trigger('enterKey');
        }
      });
      $submitButton.on('click', function (e) {
        e.preventDefault();

        if ($(this).closest('.product-list-search-form').find('.search-field').attr('data-url') === undefined) {
          searchList.search($(this).closest('.product-list-search-form').find('.search-field').val());
        } else {
          window.location.href = $(this).closest('.product-list-search-form').find('.search-field').attr('data-url');
        }
      });

      if (window.location.search.indexOf('?id=') > -1) {
        $searchField.val(decodeURIComponent(window.location.search.slice(4)));
        $submitButton.trigger('click');
      }
    }
  });
})(jQuery);
